import React, { useEffect, useState } from 'react'
import { useForm } from 'react-hook-form'
import { getAllUserAccount, findUserAccountById } from '../API/ApiService'
import { storeProduct } from '../API/ApiProduct'
import { Link, useNavigate } from 'react-router-dom'
import axios from 'axios'
export default function AddProduct() {
    const [previewImage, setPreviewImage] = useState("https://cdn.vortexs.io/api/images/7E39FDE2-2BCB-48D2-AFAC-08F8BFA48A7A/1920/w/tui-life-work-metal-radok-camera-black-lw245bg408.jpeg")
    const [users, setUsers] = useState([])
    const [imageUpload, setImageUpload] = useState()
    const navigate = useNavigate()
    const {
        register,
        handleSubmit,
        formState: { errors },
    } = useForm()
    const loadUser = async () => {
        const result = await getAllUserAccount()
        setUsers(result)
    }
    useEffect(() => {
        loadUser()
    }, [])
    const handleChange = (e) => {
        setImageUpload(e.target.files[0])
        setPreviewImage(URL.createObjectURL(e.target.files[0]))
    }
    const onSubmit = async (data) => {
        let imageUrl;
        const image = new FormData()
        image.append("file", profileImage)
        image.append("cloud_name", "dswqplrdx")
        image.append("upload_preset", "qh49wlsn")
        const response = await axios.post("https://api.cloudinary.com/v1_1/dswqplrdx/image/upload", image)
        const imageData = await response.json()
        imageURL = imageData.url.toString()
        const result = {
            code: data.code,
            name: data.name,
            image: {
                url: previewImage
            },
            user: await findUserAccountById(data.user)
        }
        await storeProduct(result)
        navigate("/product")
        console.log(result);
    }
    return (
        <div className='container'>
            <h1 className='text-secondary mb-3 text-uppercase'>New Product</h1>
            <div className='text-center'>
                <form onSubmit={handleSubmit(onSubmit)} className='row'>
                    <div className='col 6'>
                        <div className="form-floating mb-3 mt-3">
                            <input
                                type="text"
                                className="form-control"
                                id="code"
                                style={{ width: '200px' }}
                                {...register("code")}
                            />
                            <label htmlFor="code">Code</label>
                        </div>
                        <div className="form-floating mb-3 mt-3">
                            <input
                                type="text"
                                className="form-control"
                                id="name"
                                {...register("name")}
                            />
                            <label htmlFor="name">Product name</label>
                        </div>
                        <div className="form-floating mb-3 mt-3">
                            <select className="form-select" {...register("user")}>
                                <option defaultChecked disabled>User [Demo]</option>
                                {
                                    users.map((item) => (
                                        <option key={item.id} value={item.id}>{item.email}</option>
                                    ))
                                }
                            </select>
                        </div>
                    </div>
                    <div className='col-6'>
                        <img src={previewImage}
                            style={{ width: '50%' }} className="img-thumbnail" alt="..." />
                        <p className='mt-2'> <input type='file' name='image' className='btn' onChange={handleChange} /></p>
                    </div>
                    <div>
                        <button type='submit' className='btn btn-outline-success m-3'>Submit</button>
                        <Link to="/product" className='btn btn-outline-danger'>Cancel</Link>
                    </div>
                </form>
            </div>
        </div>
    )
}
